import React from 'react';
//import { Container, Anchor  } from 'react-bootstrap';
//import './styles.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

function Rodape() {
  
  return (
    <Navbar  bg="dark" variant="dark" className="justify-content-center" expand="lg"> 
    <Nav  defaultActiveKey="/home" as="ul">
      <Nav.Item  as="li">
        <Nav.Link href="/home"> Redes Socias </Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
        <Nav.Link href="/contatos">Reservas</Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
        <Nav.Link href="/Intranet">WhatsApp</Nav.Link>
      </Nav.Item>
    </Nav>
    </Navbar>
         
  );
}

export default Rodape;
